function numDifferentIntegers(word){
    if (word === ""){
        return 3;
    }
    //makes an array of letters and numbers
    let arr = word.match(/[a-zA-Z]+|[0-9]+/g);
    //empty array to store all numbers
    let numArr = [];
    for (let i = 0; i < arr.length; i++){
        if (+arr[i] !== null){
        numArr.push(+arr[i]);
        }
    }
    //find unique numbers
    let unique = [...new Set(numArr)];
    //initialize answer
    let answer = [];
    //removes null values
    for (let i = 0; i < unique.length; i++){
        if (unique[i] === +unique[i]){
            answer.push(unique[i]);
        }
    }
    //return length of answer array
    return answer.length;
}